import React, { Component } from "react";

class ThankYou extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col">
            <h2>Thanks!!</h2>
            <p>Your movie ticket is booked, below are the details</p>
            <p></p>
          </div>
        </div>
      </div>
    );
  }
}

export default ThankYou;
